import React, {Component} from "react";

class Orders extends Component{
    constructor(props) {
        super(props);
        this.state = {user: "", orders: []};
    }



    render() {


        return(
            <div className="previous-orders">
                <table className="table">
                    <thead>
                    <tr>
                        <th>ID</th>
                        <th>Date</th>
                        <th>Total</th>
                    </tr>
                    </thead>
                </table>
            </div>
        )
    }

}
export default Orders
